import React from 'react';

import Header from '../Components/Header';


import alsham from '../Img/alsham.jpg';

function Alsham(){

    return (
        <div>
        <Header/>
   <div  style={{
     margin:"50px 50px",
      width: "50%",
      padding: "10px;"}}>
        <h2>Al Sham Restaurant</h2>



<img src={alsham} alt="alsham" />

<p>:</p>
        </div>
<div>
    <p>Ресторан арабской кухни,
         в котором вы сможете попробовать вкуснейшие блюда 
         от поваров из самой Сирии! Благодаря большому 
         разнообразию в меню, качественному сервису и 
         красочному интерьеру ресторан завоевал немалую славу среди жителей столицы.</p>
</div>
        </div>
    );
}

export default Alsham;
